sympy.sympy.core.cache.wrapper:
@wraps(func)
def wrapper(*args, **kwargs):
    try:
        retval = cfunc(*args, **kwargs)
    except TypeError as e:
        if not e.args or not e.args[0].startswith('unhashable type:'):
            raise
        retval = func(*args, **kwargs)
    return retval

sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.expr.__neg__:
def __neg__(self) -> Expr:
    # Mul has its own __neg__ routine, so we just
    # create a 2-args Mul with the -1 in the canonical
    # slot 0.
    c = self.is_commutative
    return Mul._from_args((S.NegativeOne, self), c)

sympy.sympy.core.mul.__neg__:
def __neg__(self):
    c, args = self.as_coeff_mul()
    if args[0] is not S.ComplexInfinity:
        c = -c
    if c is not S.One:
        if args[0].is_Number:
            args = list(args)
            if c is S.NegativeOne:
                args[0] = -args[0]
            else:
                args[0] *= c
        else:
            args = (c,) + args
    return self._from_args(args, self.is_commutative)

sympy.sympy.simplify.trigsimp.check_args:
def check_args(x, y):
    try:
        return x.args[0] == y.args[0]
    except IndexError:
        return False

sympy.sympy.simplify.trigsimp.f:
def f(rv):
    # for simple functions
    g = getattr(rv, 'inverse', None)
    if (g is not None and isinstance(rv.args[0], g()) and
            isinstance(g()(1), TrigonometricFunction)):
        return rv.args[0].args[0]

    # for atan2 simplifications, harder because atan2 has 2 args
    if isinstance(rv, atan2):
        y, x = rv.args
        if _coeff_isneg(y):
            return -f(atan2(-y, x))
        elif _coeff_isneg(x):
            return S.Pi - f(atan2(y, -x))

        if check_args(x, y):
            if isinstance(y, sin) and isinstance(x, cos):
                return x.args[0]
            if isinstance(y, cos) and isinstance(x, sin):
                return S.Pi / 2 - x.args[0]

    return rv
